import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";

const ProductDetails = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { product } = location.state || {};
  const [selectedSize, setSelectedSize] = useState("");

  if (!product) {
    navigate("/");
    return null;
  }

  const renderStars = (rating) => {
    const fullStars = Math.floor(rating);
    const halfStar = rating % 1 !== 0;
    const stars = [];

    for (let i = 0; i < fullStars; i++) {
      stars.push("ðŸŒŸ");
    }
    if (halfStar) {
      stars.push("â­");
    }
    while (stars.length < 5) {
      stars.push("â˜†");
    }
    return stars.join(" ");
  };

  const handlePlaceOrder = () => {
    if (!selectedSize) {
      alert("Please select a size before placing the order.");
      return;
    }
    navigate("/checkout", { state: { product, selectedSize } });
  };

  return (
    <div className="product-details">
      {/* Header */}
      <header className="bg-dark text-white text-center py-5">
        <h1 className="mb-0">{product.name}</h1>
      </header>

      {/* Main Content */}
      <div className="container mt-5">
        <div className="row">
          {/* Product Image */}
          <div className="col-md-6 d-flex align-items-center justify-content-center mb-4 mb-md-0">
            <img src={product.img} alt={product.name} className="img-fluid rounded shadow-sm" />
          </div>

          {/* Product Info */}
          <div className="col-md-6">
            <h3 className="mb-3">Price: â‚¹{product.price}</h3>

            {/* Description */}
            <p>
              <strong>Product Overview:</strong> This is a detailed description of the {product.name}. 
              (You can update this section with more product info as needed.)
            </p>

            {/* Rating */}
            <div className="mt-3">
              <strong>Rating:</strong>{" "}
              <span style={{ fontSize: "24px" }}>{renderStars(product.rating || 0)}</span>
            </div>

            {/* Size Selection */}
            <div className="mt-4">
              <label htmlFor="size" className="form-label">Select Size:</label>
              <select
                id="size"
                value={selectedSize}
                onChange={(e) => setSelectedSize(e.target.value)}
                className="form-select"
              >
                <option value="">-- Select Size --</option>
                <option value="S">Small</option>
                <option value="M">Medium</option>
                <option value="L">Large</option>
                <option value="XL">X-Large</option>
              </select>
            </div>

            {/* Place Order Button */}
            <div className="mt-4">
              <button className="btn btn-primary px-4" onClick={handlePlaceOrder}>
                Place Order
              </button>
            </div>

            {/* Extra Info */}
            <div className="mt-4">
              <p>ðŸšš <strong>Free Shipping</strong> on all orders</p>
              <p>ðŸ”„ <strong>7 Days Exchange and Return</strong> available</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductDetails;
